import React, { Component } from 'react';

import { Navbar } from 'react-bootstrap';

class AppContainer extends Component {
    render() {
        return (
            <div>
                <Navbar bg="dark" fixed="top">
                    <Navbar.Brand href="#home">
                            Brand link
                    </Navbar.Brand>
                </Navbar>
            </div>
        );
    }
}

export default AppContainer;
